Game description: 
                 Five nights at Freddy's 2 - spend 5 nights as a night guard in a sinister pizzeria. Don't let the mechanical toys get to the character and kill him. In this Android game the security guard is sitting in his office, living mechanical toys are wandering around the building. They have only one goal - destroy the guard. Watch a number of surveillance cameras installed in different rooms. Deter monsters by turning the lights on and playing music. Close automatic doors on their way. Be careful, your electricity supply is limited.

Genres:Arcade


Game features:

: Great graphics
: 11 monsters
: Good controls
: Absorbing gameplay
